import './App.css';

function App() {
  return (
    <div className="App">
        <label>UserName:</label>
        <input type={'text'} placeholder={'Enter your user name'}/>
        <label>Password:</label>
        <input type={'password'} placeholder={'Enter your password'}/>
        <button>Submit</button>
    </div>
  );
}

export default App;
